import Post from"../../component/post/Post"
import { Component } from "react";

export default function Posts({posts}) {

      return (
        <div classname="posts" >
            { posts.map((p)=>

 <Post post={p}/>
 
            
             )}  
           
           
        </div>
      ) 

}
